(19,	'po_payment_request_dispute_seller',	'Seller Dispute raised for payment of purchase order',	'Dispute raised for payment of purchase order',	'<p>A dispute has been raised regarding payment for purchase order</p>\r\n\r\n<p>Please review rhe details of the dispute.</p>\r\n\r\n<p>Dispute information &ndash;&nbsp;&lt;?=&nbsp;$dispute_information&nbsp;?&gt;.</p>',	'',	1,	'2021-05-19 04:30:04',	'2021-05-20 13:02:13'),
(20,	'po_delivery_release_seller',	'Delivery release',	'Delivery release for purchase order',	'<p>Delivery has been released for the purchase order (&lt;?=$purchase_order_no?&gt;).</p>\r\n\r\n<p>Please check the details below.</p>',	'',	1,	'2021-05-19 04:30:04',	'2021-05-20 12:37:54'),
(21,	'po_delivery_release_buyer',	'Buyer Delivery release for purchase order',	'Delivery release for purchase order',	'<p>Thanks&nbsp;for&nbsp;choosing&nbsp;this&nbsp;product.</p>\r\n\r\n<p>Are&nbsp;you&nbsp;happy&nbsp;with&nbsp;the&nbsp;services&nbsp;been&nbsp;provided?&nbsp;Just&nbsp;spare&nbsp;few&nbsp;minutes&nbsp;to&nbsp;provide&nbsp;us&nbsp;your&nbsp;valuable&nbsp;feedback&nbsp;which&nbsp;will&nbsp;make&nbsp;Mambodubai&nbsp;even&nbsp;better&nbsp;for&nbsp;you&nbsp;and&nbsp;other&nbsp;customers.</p>',	'',	1,	'2021-05-19 04:30:04',	'2021-05-19 04:54:52'),
(22,	'po_delivery_accept_seller',	'Delivery accept',	'Delivery acceptance for purchase order',	'<p>Delivery has been accepted for purchase order (&lt;?=$purchase_order_no?&gt;).</p>\r\n\r\n<p>Please check the order details</p>',	'',	1,	'2021-05-19 04:30:04',	'2021-05-20 12:38:48'),
(23,	'po_delivery_accept_buyer',	'Buyer Delivery acceptance for purchase order',	'Delivery acceptance for purchase order',	'<p>Thanks&nbsp;for&nbsp;choosing&nbsp;this&nbsp;product.</p>\r\n\r\n<p>Are&nbsp;you&nbsp;happy&nbsp;with&nbsp;the&nbsp;services&nbsp;been&nbsp;provided?&nbsp;Just&nbsp;spare&nbsp;few&nbsp;minutes&nbsp;to&nbsp;provide&nbsp;us&nbsp;your&nbsp;valuable&nbsp;feedback&nbsp;which&nbsp;will&nbsp;make&nbsp;Mambodubai&nbsp;even&nbsp;better&nbsp;for&nbsp;you&nbsp;and&nbsp;other&nbsp;customers.</p>',	'',	1,	'2021-05-19 04:30:04',	'2021-05-19 04:55:01'),
(24,	'po_delivery_dispute_buyer',	'Delivery dispute Buyer',	'Delivery dispute for purchase order',	'<p>A&nbsp;dispute&nbsp;has&nbsp;been&nbsp;raised&nbsp;regarding&nbsp;delivery&nbsp;of&nbsp;purchase&nbsp;order&nbsp;(&nbsp;&lt;?=&nbsp;$purchase_order_no&nbsp;?&gt;&nbsp;).</p>\r\n\r\n<p>Please&nbsp;review&nbsp;the&nbsp;details</p>\r\n\r\n<p>Dispute&nbsp;information&nbsp;&ndash;&nbsp;&lt;?=&nbsp;$dispute_information&nbsp;?&gt;.</p>',	'',	1,	'2021-05-19 04:30:04',	'2021-05-20 12:42:57'),
(25,	'po_delivery_dispute_seller',	'Delivery dispute Seller',	'Delivery dispute for purchase order',	'<p>A&nbsp;dispute&nbsp;has&nbsp;been&nbsp;raised&nbsp;regarding&nbsp;delivery&nbsp;of&nbsp;purchase&nbsp;order&nbsp;(&nbsp;&lt;?=&nbsp;$purchase_order_no&nbsp;?&gt;&nbsp;).</p>\r\n\r\n<p>Please&nbsp;review&nbsp;the&nbsp;details of dispute.</p>\r\n\r\n<p>Dispute&nbsp;information&nbsp;&ndash;&nbsp;&lt;?=&nbsp;$dispute_information&nbsp;?&gt;.</p>',	'',	1,	'2021-05-19 04:30:04',	'2021-05-20 12:34:07'),
(26,	'rq_callback_buyer',	'Buyer Your Request for Callback',	'Your Request for Callback',	'<p>Thanks&nbsp;for&nbsp;choosing&nbsp;MamboDubai.</p>\r\n\r\n<p>Your&nbsp;call&nbsp;back&nbsp;request&nbsp;has&nbsp;been&nbsp;successfully&nbsp;submitted&nbsp;to&nbsp;the&nbsp;seller.&nbsp;&nbsp;The&nbsp;seller&nbsp;will&nbsp;get&nbsp;back&nbsp;to&nbsp;you&nbsp;soon.respond&nbsp;to&nbsp;you&nbsp;as&nbsp;soon&nbsp;as&nbsp;possible.</p>\r\n\r\n<p>The&nbsp;details&nbsp;of&nbsp;your&nbsp;request&nbsp;are&nbsp;as&nbsp;follows.&nbsp;Please&nbsp;check&nbsp;to&nbsp;ensure&nbsp;their&nbsp;accuracy&nbsp;&ndash;&nbsp;</p>',	'',	1,	'2021-05-19 04:30:04',	'2021-05-19 05:50:48'),
(27,	'rq_callback_seller',	'Seller Request for Callback',	'Callback request.',	'<p>You&nbsp;have&nbsp;received&nbsp;&nbsp;a&nbsp;call&nbsp;back&nbsp;request&nbsp;&nbsp;from&nbsp;a&nbsp;potential&nbsp;buyer.</p>\r\n\r\n<p>Please&nbsp;review&nbsp;the&nbsp;details&nbsp;below&nbsp;and&nbsp;get&nbsp;in&nbsp;touch&nbsp;with&nbsp;the&nbsp;buyer&nbsp;at&nbsp;your&nbsp;earliest&nbsp;convenience.</p>',	'',	1,	'2021-05-19 04:30:04',	'2021-05-20 12:46:18'),
(28,	'welcome_email',	'Welcome Email',	'Welcome to MamboDubai',	'<p>Congratulations on successfully registering on MamboDubai.</p>\r\n\r\n<p>We connect global sellers with buyers to create affordable and cost effective business solutions.</p>\r\n\r\n<p>Our goal is to make your&nbsp;trade&nbsp;journey&nbsp; easy and to reduce your risk..</p>\r\n\r\n<p>MamboDubai is a business-to-business trading platform. Please complete your business profile and&nbsp; join as a verified business on our platform.</p>',	'',	1,	'2021-05-13 12:05:23',	'2021-05-20 06:07:49'),
(29,	'vefiry_email',	'Verification',	'Please verify your account.',	'<p>To&nbsp;complete&nbsp;your&nbsp;registration,&nbsp;please&nbsp;verify&nbsp;your&nbsp;email&nbsp;by clicking&nbsp;on&nbsp;this&nbsp;button.</p>',	'',	1,	'2021-05-13 12:05:23',	'2021-05-20 05:57:52'),
(30,	'seller_add_product',	'Seller Add Product',	'Successfully added product.',	'<p>Your&nbsp;product has&nbsp;been&nbsp;submitted&nbsp;successfully&nbsp;and&nbsp;it&nbsp;is&nbsp;pending&nbsp;for&nbsp;approval.&nbsp;You&nbsp;will&nbsp;be&nbsp;notified&nbsp;by&nbsp;email&nbsp;again&nbsp;once&nbsp;approved.</p>\r\n\r\n<p>You&nbsp;product&nbsp;details&nbsp;are&nbsp;as&nbsp;follows&nbsp;-</p>',	'',	1,	NULL,	NULL);
