INSERT INTO `posts` (`id`, `title`, `meta_title`, `slug`, `meta_keywords`, `category_id`, `description`, `meta_description`, `image`, `sort_order`, `status`, `created_at`, `updated_at`) VALUES
(3,	'7 Best Sedan Cars to buy in UAE | Under AED 20,000',	'7-best-sedan-cars-to-buy-in-uae-under-aed-20000',	'',	'',	5,	'<div class=\"post-content description cf entry-content has-share-float content-normal\">\r\n<p>The process of buying a family car is not an easy forte. Finding your needs and comfort in one car is a task one must be well prepared for. For the people with love for Sedans, CarSwitch, the best place to&nbsp;<a href=\"https://carswitch.com/dubai/used-cars/search\">buy pre-owned cars in Dubai</a>&nbsp;brings you the best under AED 20,000. Find our list below!</p>\r\n<h2><strong>Volkswagen Passat&nbsp;</strong></h2>\r\n<p><img class=\"aligncenter wp-image-1964 size-full\" src=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/Volkswagen-Passat.jpg\" sizes=\"(max-width: 1200px) 100vw, 1200px\" srcset=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/Volkswagen-Passat.jpg 1200w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Volkswagen-Passat-300x158.jpg 300w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Volkswagen-Passat-1024x538.jpg 1024w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Volkswagen-Passat-768x403.jpg 768w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Volkswagen-Passat-175x92.jpg 175w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Volkswagen-Passat-450x236.jpg 450w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Volkswagen-Passat-1170x614.jpg 1170w\" alt=\" Volkswagen Passat\" width=\"1200\" height=\"630\" loading=\"lazy\" /></p>\r\n<p>Launched in 1973, the&nbsp;<a href=\"https://carswitch.com/uae/used-cars/volkswagen/passat\">Volkswagen Passat</a>&nbsp;series are currently in their eighth generation. The Passat carries internal designations B1, B2, etc. It is a midsize sedan and is a 2.5 litres I5 engine. The five-cylinder engine is a 2 wheel drive with an automatic transmission. Coming with cruise control and reversing camera, the five-seater sedan has steering wheel controls, power locks and power windows. Being a top sale in UAE, the Passat is also sold in the North American, South Korean and Chinese markets.</p>\r\n<h2><strong>Toyota Camry</strong></h2>\r\n<p><img class=\"aligncenter wp-image-1965 size-full\" src=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Camry.jpg\" sizes=\"(max-width: 1200px) 100vw, 1200px\" srcset=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Camry.jpg 1200w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Camry-300x158.jpg 300w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Camry-1024x538.jpg 1024w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Camry-768x403.jpg 768w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Camry-175x92.jpg 175w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Camry-450x236.jpg 450w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Camry-1170x614.jpg 1170w\" alt=\" Toyota Camry\" width=\"1200\" height=\"630\" loading=\"lazy\" /></p>\r\n<p>The Toyota variant being processed since 1982, the&nbsp;<a href=\"https://carswitch.com/uae/used-cars/toyota/camry\">Camry</a>&nbsp;is a mid-size sedan known as Toyota&rsquo;s &ldquo;second world car&rdquo;. The 2.5 litres hybrid comes with an automatic transmission. It has leather seats, parking sensors, reversing camera and cruise control to add to the luxury of the car. Additionally, it has steering wheel controls, power locks, power windows and power seats.</p>\r\n<h2><strong>Honda City</strong></h2>\r\n<p><img class=\"aligncenter wp-image-1966 size-full\" src=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/honda-city.jpg\" sizes=\"(max-width: 1200px) 100vw, 1200px\" srcset=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/honda-city.jpg 1200w, https://blog.mambodubai.com/wp-content/uploads/2020/12/honda-city-300x158.jpg 300w, https://blog.mambodubai.com/wp-content/uploads/2020/12/honda-city-1024x538.jpg 1024w, https://blog.mambodubai.com/wp-content/uploads/2020/12/honda-city-768x403.jpg 768w, https://blog.mambodubai.com/wp-content/uploads/2020/12/honda-city-175x92.jpg 175w, https://blog.mambodubai.com/wp-content/uploads/2020/12/honda-city-450x236.jpg 450w, https://blog.mambodubai.com/wp-content/uploads/2020/12/honda-city-1170x614.jpg 1170w\" alt=\" honda city\" width=\"1200\" height=\"630\" loading=\"lazy\" /></p>\r\n<p>Currently selling in its fifth generation, the&nbsp;<a href=\"https://carswitch.com/uae/used-cars/honda/city\">Honda City</a>&nbsp;is a go-to sedan people look for. Coming with a five-person seating, the Honda City is a next-generation model. The 1.5 litres I4 engine mid-size car comes with a 2 wheel drive and automatic transmission. The four-cylinder drive comes with the basic features of steering wheel controls, power locks, power windows and power steering. To add to the basic features, the console features include cruise control and parking sensors.</p>\r\n<h2><strong>Mitsubishi Lancer</strong></h2>\r\n<p><img class=\"aligncenter size-full wp-image-1967\" src=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/mit-lancer.jpg\" sizes=\"(max-width: 1200px) 100vw, 1200px\" srcset=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/mit-lancer.jpg 1200w, https://blog.mambodubai.com/wp-content/uploads/2020/12/mit-lancer-300x158.jpg 300w, https://blog.mambodubai.com/wp-content/uploads/2020/12/mit-lancer-1024x538.jpg 1024w, https://blog.mambodubai.com/wp-content/uploads/2020/12/mit-lancer-768x403.jpg 768w, https://blog.mambodubai.com/wp-content/uploads/2020/12/mit-lancer-175x92.jpg 175w, https://blog.mambodubai.com/wp-content/uploads/2020/12/mit-lancer-450x236.jpg 450w, https://blog.mambodubai.com/wp-content/uploads/2020/12/mit-lancer-1170x614.jpg 1170w\" alt=\" mit lancer\" width=\"1200\" height=\"630\" loading=\"lazy\" /></p>\r\n<p>The compact built, mid-size sedan;&nbsp;<a href=\"https://carswitch.com/uae/used-cars/mitsubishi/lancer\">Mitsubishi lancer&nbsp;</a>has been in the market since 1973. With several new variants, the sedan is in a ninth-generation model. The 2.0 litres engine is a 2 wheel drive and automatic transmission. It has four cylinders and is a fuel-efficient drive. With basic features of steering wheel controls, power locks, power windows and power steering; the console features include sun and moon roof, parking sensors, reversing camera and cruise control.</p>\r\n<h2><strong>Nissan Altima</strong></h2>\r\n<p><img class=\"aligncenter size-full wp-image-1968\" src=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/Nissan-Altima.jpg\" sizes=\"(max-width: 1200px) 100vw, 1200px\" srcset=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/Nissan-Altima.jpg 1200w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Nissan-Altima-300x158.jpg 300w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Nissan-Altima-1024x538.jpg 1024w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Nissan-Altima-768x403.jpg 768w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Nissan-Altima-175x92.jpg 175w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Nissan-Altima-450x236.jpg 450w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Nissan-Altima-1170x614.jpg 1170w\" alt=\" Nissan Altima\" width=\"1200\" height=\"630\" loading=\"lazy\" /></p>\r\n<p>Currently working on their 2021 model, the&nbsp;<a href=\"https://carswitch.com/uae/used-cars/nissan/altima\">Nissan Altima</a>&nbsp;has never failed the consumers with its comfort drive and luxury feel. The five-seater family car is a 2.5 litres I4 engine. The automatic transmission engine mid-size sedan is a 2 wheel drive. Coming with the basic features of steering wheel control, power locks, power windows and power steering; the console features add parking sensors, reversing camera. keyless start, cruise control and keyless entry.</p>\r\n<h2><strong>Chevrolet Cruze&nbsp;</strong></h2>\r\n<p><img class=\"aligncenter size-full wp-image-1969\" src=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/7-best-sedan-car-buy-UAE-1200-630-1.jpg\" sizes=\"(max-width: 1200px) 100vw, 1200px\" srcset=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/7-best-sedan-car-buy-UAE-1200-630-1.jpg 1200w, https://blog.mambodubai.com/wp-content/uploads/2020/12/7-best-sedan-car-buy-UAE-1200-630-1-300x158.jpg 300w, https://blog.mambodubai.com/wp-content/uploads/2020/12/7-best-sedan-car-buy-UAE-1200-630-1-1024x538.jpg 1024w, https://blog.mambodubai.com/wp-content/uploads/2020/12/7-best-sedan-car-buy-UAE-1200-630-1-768x403.jpg 768w, https://blog.mambodubai.com/wp-content/uploads/2020/12/7-best-sedan-car-buy-UAE-1200-630-1-175x92.jpg 175w, https://blog.mambodubai.com/wp-content/uploads/2020/12/7-best-sedan-car-buy-UAE-1200-630-1-450x236.jpg 450w, https://blog.mambodubai.com/wp-content/uploads/2020/12/7-best-sedan-car-buy-UAE-1200-630-1-1170x614.jpg 1170w\" alt=\" 7 best sedan car buy UAE 1200 630 1\" width=\"1200\" height=\"630\" loading=\"lazy\" /></p>\r\n<p>The&nbsp;<a href=\"https://carswitch.com/uae/used-cars/chevrolet/cruze\">Chevrolet Cruze</a>&nbsp;is a 2008 Japanese manufacturer which has not failed to fit the current market. The mid-size compact built sedan is a 1.4 litres L4 engine with four cylinders. It has a 2 wheel drive and automatic transmission. Known for its comfort drive, the Cruze has basic features of steering wheel control, power locks, power windows and power steering. To add, it comes with the console features of leather seats, sun and moon roof, parking sensors, reversing camera, keyless start, cruise control and keyless entry.</p>\r\n<h2><strong>Toyota Corolla&nbsp;</strong></h2>\r\n<p><img class=\"aligncenter size-full wp-image-1970\" src=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Corolla.jpg\" sizes=\"(max-width: 1200px) 100vw, 1200px\" srcset=\"https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Corolla.jpg 1200w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Corolla-300x158.jpg 300w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Corolla-1024x538.jpg 1024w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Corolla-768x403.jpg 768w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Corolla-175x92.jpg 175w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Corolla-450x236.jpg 450w, https://blog.mambodubai.com/wp-content/uploads/2020/12/Toyota-Corolla-1170x614.jpg 1170w\" alt=\" Toyota Corolla\" width=\"1200\" height=\"630\" loading=\"lazy\" /></p>\r\n<p>Known as one of the best family cars, the&nbsp;<a href=\"https://carswitch.com/uae/used-cars/toyota/corolla\">Toyota Corolla</a>&nbsp;is a compact/subcompact series by the Japanese manufacturer. Manufacturing since 1966, the Corolla series have failed to make it to the top lists for comfort and fuel efficiency. The four doors five seaters is a 2 litres engine. It has a 2 wheel drive and automatic transmission. Coming with steering wheel controls, power locks and power windows as basic features; the sedan has leather seats, parking sensors, reversing camera and cruise control to add to its comfort and luxury.</p>\r\n<p>Our list is complete with the finest of them all! Ensuring the best quality&nbsp;<a href=\"https://carswitch.com/dubai/used-cars/search\">second-hand cars in Dubai</a>, all these variants are available on our website. Do not miss your chance to find the best deals online and visit&nbsp;<a href=\"https://carswitch.com/\">CarSwitch</a>&nbsp;now!</p>\r\n</div>',	'',	'blogpost_image_3.jpg',	0,	1,	'2020-12-24 09:28:57',	'2021-03-05 08:46:45'),
(5,	'Oil jumps to highest since February amid stimulus optimism',	'oil-jumps-to-highest-since-february-amid-stimulus-optimism',	'',	'',	5,	'<div class=\"post-content description cf entry-content has-share-float content-normal\">\r\n<div class=\"story-block\">\r\n<p>Dubai:&nbsp;Oil surged to the highest in nearly 10 months in New York alongside a broader market rally as breakthroughs on US&nbsp;stimulus talks combined with the Covid-19 vaccine rollout stoked optimism around a demand revival.</p>\r\n</div>\r\n<div class=\"story-block\">\r\n<p>US&nbsp;benchmark crude futures rose 1.3 per cent&nbsp;on Tuesday after Senate Majority Leader Mitch McConnell said Congress will not leave for the year without a spending package, as talks continue to finalize Covid-19 relief. Meanwhile, Moderna Inc.&rsquo;s vaccine was deemed safe by US. regulators, clearing the way for a second shot to quickly gain emergency authorization.</p>\r\n</div>\r\n<div class=\"story-block\">\r\n<p>&ldquo;Oil&rsquo;s reacting to pretty significant increases in risk appetite,&rdquo; said Bart Melek, head of global commodity strategy at TD Securities. &ldquo;But with the second wave probably continuing to damage demand growth and inventories likely staying at somewhat elevated levels, the market is having second thoughts about going materially higher.&rdquo;</p>\r\n</div>\r\n<div class=\"story-block\">\r\n<p>Prices edged lower following settlement after the industry-funded American Petroleum Institute was said to report domestic crude supplies rose by almost 2 million barrels last week. Earlier, the International Energy Agency trimmed its demand forecast for 2021 and said the crude oil glut left behind by the coronavirus pandemic will not likely clear until the end of next year.</p>\r\n</div>\r\n<div class=\"story-block\">\r\n<p>Oil futures have surged recently to highs not seen since the pandemic sent prices for a tailspin, supported by indications that a widespread vaccine rollout will boost the economy and aid demand. Imported containers loaded at the Port of Los Angeles in November increased by roughly a quarter year-over-year, signaling a bump in demand.</p>\r\n</div>\r\n<div class=\"story-block\">\r\n<p>Still, the IEA&rsquo;s dismal demand projections follow OPEC&rsquo;s decision to cut its own forecasts for consumption in the first quarter of 2021 as the group and its allies prepare to start returning some supply to the market from January. Meanwhile, in the U.S., the number of Americans taking road trips during this Christmas is set to decline as much as 25% as people stay home amid soaring virus cases, according to GasBuddy.</p>\r\n</div>\r\n<div class=\"story-block\">\r\n<p>&ldquo;People are forgetting that there&rsquo;s a couple of triggers that have to happen before oil demand really comes back,&rdquo; said Stewart Glickman, energy equity analyst at CFRA Research. &ldquo;The first half of the year we&rsquo;re going to see some resurgence of weakness in oil demand, because it&rsquo;s going to take time before everybody feels comfortable enough for things to start reopening fully.&rdquo;</p>\r\n</div>\r\n<div class=\"story-block\">\r\n<p>The nearest portion of the futures and swaps markets are highlighting the mixed outlook. Brent&rsquo;s prompt time spread was on the verge of a flip back into contango, where near-dated contracts are cheaper than later ones. That compares with a bullish backwardation of as much as 18 cents last week. At the same time, the Middle East Dubai benchmark has been moving further into backwardation.</p>\r\n</div>\r\n<div class=\"story-block\">\r\n<p>The API report also showed refined products rose last week, with distillate supplies notching a 4.76-million-barrel build last week. If confirmed by the Energy Information Administration&rsquo;s storage figures on Wednesday, that would be the third week in a row that distillate inventories rose after more than two months of consecutive draws.</p>\r\n</div>\r\n</div>',	'',	'blogpost_image_5.jpg',	0,	1,	'2020-12-24 12:02:49',	'2021-03-05 08:41:04'),
(6,	'Bitumen – Current Opportunities',	'bitumen-current-opportunities',	'',	'',	5,	'<div class=\"post-content description cf entry-content has-share-float content-normal\">\r\n<p><em>Our research team regularly updates high-quality and accurate analysis of different markets, competitive intelligence, and other important subjects. We also update you on how to capitalize on the knowledge gained using the network that you have. <strong>We currently see big opportunities in the Bitumen/Asphalt market.</strong></em></p>\r\n<p>Bitumen Uses</p>\r\n<p>Bitumen, also known as asphalt is a black, sticky, and highly viscous liquid or semi-solid form of petroleum. The most common use is in the road construction and waterproofing products. The contract size usualy <strong>10 tons/lo</strong>t. The 70# Class-A road bitumen is widely traded onFutures Exchange.</p>\r\n<p>Current Prices / Opportunities</p>\r\n<figure class=\"wp-block-image size-large\"><img class=\"alignnone wp-image-1839\" title=\"&ldquo;Bitumen&rdquo;\" src=\"https://blog.mambodubai.com/wp-content/uploads/2020/04/Bitumen-prices.jpg\" sizes=\"(max-width: 339px) 100vw, 339px\" srcset=\"https://blog.mambodubai.com/wp-content/uploads/2020/04/Bitumen-prices.jpg 339w, https://blog.mambodubai.com/wp-content/uploads/2020/04/Bitumen-prices-300x225.jpg 300w, https://blog.mambodubai.com/wp-content/uploads/2020/04/Bitumen-prices-175x131.jpg 175w\" alt=\"Bitumen\" width=\"339\" height=\"254\" loading=\"lazy\" />\r\n<figcaption>Bitumen prices have never been so low. But prices will definitely go up.</figcaption>\r\n</figure>\r\n<p>Market Price has gone down with construction and other projects being halted due to the COVID-19 outbreak. Additionally, big inventories across Asia in the first quarter are being carried over into the second quarter. In the coming few months, demand will remain weak and that will add pressure to supplies and prices. That makes Bitumen the best commodity to buy and store especially for countries in Asia and Africa that have current high value construction projects.</p>\r\n<p>Are you interested in buying or your network is looking to buy Bitumen. If you want inquire about the commodity from a reliable supplier, please click here. A seller with legal mandate will contact you in less than 24 hours.</p>\r\n</div>',	'',	'blogpost_image_6.jpg',	0,	1,	'2020-04-30 12:04:18',	'2021-03-05 08:43:42'),
(7,	'South Korea ramps up production, export of COVID-19 test kits',	'south-korea-ramps-up-production-export-of-covid-19-test-kits',	'',	'',	5,	'<div class=\"post-content description cf entry-content has-share-float content-normal\">\r\n<p>As the virus spreads around the world, demand for the testing systems and kits has increased. South Korean biotech firms are racing to meet that demand, with innovative technologies that can help stem the contagion.</p>\r\n<p>South Korea has emerged as the top exporter of coronavirus testing kits during the COVID-19 pandemic, with at least 106 countries procuring the essential medical equipment from Seoul.</p>\r\n<p>Following an exponential boost in demand, South Korea&rsquo;s exports of coronavirus testing kits in the first 20 days of April stood at $131.9 million, Yonhap News Agency reported on Wednesday.</p>\r\n<p>According to data released by Korea Customs Service, exports of test kits during the same period last year amounted to $7.25 million.</p>\r\n<p>The data shows Brazil, the country with most COVID-19 cases in South America, has been the top importer, procuring kits worth $19.2 million.</p>\r\n<p>It is followed by two of the world&rsquo;s hardest-hit countries &ndash; the U.S. with $15.5 million worth of imports and Italy with $14.8 million.</p>\r\n<p><strong>International approval</strong></p>\r\n<p>A coronavirus test kit produced by a major South Korean manufacturer has been granted emergency approval by the U.S. Food and Drug Administration (FDA).</p>\r\n<p>&nbsp;</p>\r\n<p>If you want to bulk order, the COVID-19 rapid test kits manufactured in Korea, please fill out this form. A manufacturer with FDA approval will contact you in less than 24 hours.</p>\r\n</div>',	'',	'blogpost_image_7.jpg',	0,	1,	'2020-04-29 05:31:37',	'2021-03-05 08:45:20'),
(8,	'Suez blockage sets shipping rates racing, oil and gas tankers diverted away',	'suez-blockage-sets-shipping-rates-racing-oil-and-gas-tankers-diverted-away',	'',	'',	5,	'<p>Reeling from the blockage in the Suez Canal, shipping rates for oil product tankers have nearly doubled this week, and several vessels were diverted away from the vital waterway as a giant container ship remained wedged between both banks.</p>\r\n<div>&nbsp;</div>\r\n<div id=\"_forkInArticleAdContainer\" data-contextads-viberetg=\"undefined\"><ins id=\"revive-0-0\" class=\"prd87238502\" data-zoneid=\"\" data-seq=\"0\" data-loaded=\"1\"></ins></div>\r\n<p>The 400 metres long Ever Given has been stuck in the canal since Tuesday and efforts are under way to free the vessel although the process may take weeks amid bad weather.</p>\r\n<p>The suspension of traffic through the narrow channel linking Europe and Asia has deepened problems for shipping lines that were already facing disruption and delays in supplying retail goods to consumers.</p>\r\n<p>Analysts expect a larger upward impact on smaller tankers and oil products, like naphtha and fuel oil exports from Europe to Asia, if the canal remained shut for weeks.</p>\r\n<p class=\"_111956\">&ldquo;Around 20 per cent of Asia&rsquo;s naphtha is supplied by the Mediterranean and Black Sea via the Suez Canal,&rdquo; said Sri Paravaikkarasu, director for Asia oil at FGE, adding that re-routing ships around the Cape of Good Hope could pile about two more weeks to the voyage and more than 800 tonnes of fuel consumption for Suezmax tankers.</p>\r\n<p>Fuel is a ship&rsquo;s single biggest cost, representing up to 60 per cent of operating expenses.</p>\r\n<p>By contrast, an already weak Asian gasoil, or diesel, market is also being made worse by the blockage since Asia exports the fuel to markets in the west, like Europe, of which more than 60% flowed via the chocked Canal in 2020, according to FGE.</p>\r\n<p>More than 30 oil tankers have been waiting at either side of the canal to pass through since Tuesday, shipping data on Refinitiv showed.</p>\r\n<p>&ldquo;Aframax and Suezmax rates in the Mediterranean have also reacted first as the market starts to price in fewer vessels being available in the region,&rdquo; shipbroker Braemar ACM Shipbroking said.</p>\r\n<p>At least four Long-Range 2 tankers that might have been headed towards Suez from the Atlantic basin are now likely to be evaluating a passage around the Cape of Good Hope, Braemar ACM said. Each LR-2 tanker can carry around 75,000 tonnes of oil.</p>\r\n<p>Rising demand for Atlantic Basin crude within Europe will also increase the use of these smaller tankers and support freight rates, it added.</p>\r\n<p>The cost of shipping clean products, such as gasoline and diesel, from the Russian port of Tuapse on the Black Sea to southern France increased from $1.49 per barrel on March 22 to $2.58 a barrel on March 25, a 73% increase, according to Refinitiv.</p>\r\n<p>The shipping index benchmark for LR2 vessels from the Middle East to Japan, also known as TC1, had climbed to 137.5 worldscale points as of early Friday, compared with 100 worldscale points last week, said Anoop Jayaraj, clean tanker broker at Fearnleys Singapore.</p>\r\n<p>Similarly, the index for freight rates for Long-Range 1 (LR1) vessels on the same route, known as TC5, stood at 130 worldscale points on Friday, up from 125 at the end of last week. Worldscale is an industry tool used to calculate freight rates.</p>\r\n<p>The impact of the shipping delays on energy markets is likely to be mitigated by demand for crude oil and liquefied natural gas (LNG) being in the low season, analysts said.</p>\r\n<p>&ldquo;The seasonal nature of this flow means that we are unlikely to see pressure put on LNG shippers moving cargoes to the east as the longer and cheaper Cape routes are favoured,&rdquo; data intelligence firm Kpler said.</p>\r\n<p>Several LNG tankers have been diverted, one Singapore-based shipbroker said, adding that sentiment for LNG tanker rates are more positive following the incident.</p>\r\n<p>He added that some European buyers anticipating delays of LNG from Qatar may be considering other options such as buying in the spot market. Still, with demand for LNG being in the low season, the impact may be minimal, analysts said.</p>\r\n<p>If the blockage lasts for two weeks, about one million tonnes of LNG could be delayed for delivery to Europe, Rystad Energy&rsquo;s head of gas and power markets Carlos Torres Diaz said in a note on Thursday.</p>\r\n<p>This could double to more than two million tonnes of delayed cargo deliveries in a worst-case scenario of the Canal being blocked for four weeks, he added.</p>\r\n<p>Meanwhile, oil traders told Reuters they are adopting a wait-and-see approach to see if a higher tide due on Sunday would help.</p>\r\n<div id=\"v-khaleejtimes-0\"></div>\r\n<p>&ldquo;We have some cargoes stuck... Going around the Cape of Good Hope will be worse,&rdquo; a trader with a western firm said.&nbsp;<em>&mdash; Reuters</em></p>',	'',	'blogpost_image_8.JPG',	0,	1,	'2021-03-31 10:46:53',	'2021-03-31 10:46:53');
