(280,	'Libbey Perfect Cognac Set',	'Libbey Perfect Cognac Set',	'<h1>Libbey Perfect Cognac Set</h1>',	'Libbey, Perfect, Cognac Set, Hospitality, Hotel',	5,	1,	'<p>The Libbey Craft Spirits 4-piece Cognac Glass Set is substantial, attractive, and bespoke. The glasses enhance the artisanal libations that craft spirits aficionados crave. They&rsquo;re compact enough for cognac neat but roomy enough for cocktails or soft drinks. Join the craft spirits movement and share your originality and good taste.</p>\r\n\r\n<p>&bull; Lace your fingers comfortably around the smooth, sturdy stem and cradle the bowl, warming your drink<br />\r\n&bull; Wide bowl allows your cognac to breathe and release its natural aromas<br />\r\n&bull; Durable and dishwasher safe for quick, easy cleanup<br />\r\n&bull; Includes 4, 12-ounce cognac glasses</p>\r\n\r\n<p>4- 12 oz Cognac Glasses.</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>WEIGHT</th>\r\n			<td>1.9 lbs</td>\r\n		</tr>\r\n		<tr>\r\n			<th>DIMENSIONS</th>\r\n			<td>7 x 4 x 10 in</td>\r\n		</tr>\r\n		<tr>\r\n			<th>SCC</th>\r\n			<td><a href=\"https://retail.libbey.com/scc/500052/\">500052</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>SET PIECES</th>\r\n			<td><a href=\"https://retail.libbey.com/set-pieces/4/\">4</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th>OUNCE CAPACITY</th>\r\n			<td><a href=\"https://retail.libbey.com/ounce-capacity/12/\">12</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th>MILLILITER CAPACITY</th>\r\n			<td><a href=\"https://retail.libbey.com/milliliter-capacity/355/\">355</a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>',	4,	'Nebiyu',	0.00,	0.00,	1,	0,	1,	2,	1,	'c275827011e1fd23562b863211150fae.png',	NULL,	'libbey-perfect-cognac-set-1',	'2021-02-08 07:27:07',	'2021-02-08 19:27:07',	'2021-02-11 07:15:41',	NULL,	69,	NULL),
(281,	'Libbey Brookline DOF 4-pc set',	'Libbey Brookline DOF 4-pc set',	'<h1>Libbey Brookline DOF 4-pc set</h1>',	'Libbey Brookline DOF 4-pc set',	5,	1,	'<p>The Libbey Signature Kentfield 4-piece Rocks Glass Set possesses unprecedented levels of brightness, clarity, and resilience, along with a balanced, versatile design and classically elegant shape. Their substantial base complements their smooth rim and round sides, clearly showcasing your finest whiskey, gin, traditional old fashioned, or soft drink.</p>\r\n\r\n<p>&bull; Luxurious Signature line is crafted with state-of-the-art ClearFire&trade; glass composition, providing superior brilliance and strength<br />\r\n&bull; Laser-cut rim ensures a fine, even, chip-resistant edge; reinforced base delivers extra stability<br />\r\n&bull; Durable and dishwasher safe for quick, easy cleanup<br />\r\n&bull; Made lead-free in the USA<br />\r\n&bull; Includes 4, 12-ounce double old fashioned rocks glasses</p>\r\n\r\n<p>12 oz Brookline DOF 4-pc set. Dimensions: Height- 3.5&Prime;, Top Diameter- 3.25&Prime;, Bottom Diameter- 3&Prime;, Widest Diameter- 3.5&Prime;</p>\r\n\r\n<h2>Additional information</h2>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>WEIGHT</th>\r\n			<td>3.6 lbs</td>\r\n		</tr>\r\n		<tr>\r\n			<th>DIMENSIONS</th>\r\n			<td>7.38 x 7.38 x 4 in</td>\r\n		</tr>\r\n		<tr>\r\n			<th>SCC</th>\r\n			<td><a href=\"https://retail.libbey.com/scc/632753/\">632753</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>SET PIECES</th>\r\n			<td><a href=\"https://retail.libbey.com/set-pieces/4/\">4</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th>OUNCE CAPACITY</th>\r\n			<td><a href=\"https://retail.libbey.com/ounce-capacity/12/\">12</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th>MILLILITER CAPACITY</th>\r\n			<td><a href=\"https://retail.libbey.com/milliliter-capacity/355/\">355</a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>',	4,	'Nebiyu',	0.00,	0.00,	1,	0,	1,	2,	1,	'7a245a50655c0c1d61e3