gn:center\">Skirt</td>\r\n			<td style=\"vertical-align:center\">100 Polyester &nbsp;Interlock</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:center\">Size</td>\r\n			<td style=\"vertical-align:center\">Customized Size</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:center\">Feature</td>\r\n			<td style=\"vertical-align:center\">Waterproof, Anti Dust Mite,Air-Permeable, Anti-Bacteria, Quick-drying moisture, Environmental Protection.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:center\">Use<br />\r\n			&nbsp;</td>\r\n			<td style=\"vertical-align:center\">Home, Hotel, Hospital, School<br />\r\n			&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Feature:&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>&middot; &nbsp;Extra soft and very absorbent&nbsp;</li>\r\n	<li>&nbsp;&middot; Waterproof, yet breathable - similar to human skin&nbsp;</li>\r\n	<li>&nbsp;&middot; Protective against stains such as spills, sweat, bodily fluids, bed wetting&nbsp;</li>\r\n	<li>&nbsp;&middot; Effective in preventing dust mites and bacteria from breeding inside the mattress, which are a significant cause &nbsp;of asthma, rhinitis and eczema&nbsp;</li>\r\n	<li>&nbsp;&middot; Especially helpful in cases of incontinence&nbsp;</li>\r\n	<li>&nbsp;&middot; Machine washable and tumble dry ready&nbsp;</li>\r\n	<li>&nbsp;&middot; Durable with the ability to be washed in excess of 50 &nbsp;times&nbsp;</li>\r\n	<li>&nbsp;&middot; Able to be sterilized at 65&deg;C/150&deg;F&nbsp;</li>\r\n	<li>&nbsp;&middot; Ultra-thin, four-way stretch material does not detract from mattress comfort &nbsp; &nbsp;</li>\r\n</ul>',	4,	'Nebiyu',	0.00,	0.00,	1,	0,	1,	2,	1,	'21275613a799d5a9afd2d580ebf35e6c.jpg',	NULL,	'top-grade-hypoallergenic-polyester-fiber-filled-waterproof-mattress-protector-1',	'2021-02-08 08:00:16',	'2021-02-08 20:00:16',	'2021-02-11 07:10:59',	NULL,	69,	NULL),
