(338,	'Malaysia Low Acid White Coffee Carton Box',	'Malaysia Low Acid White Coffee Carton Box',	'<p>Malaysia Low Acid White Coffee Carton Box</p>',	'Malaysia Low Acid White Coffee Carton Box',	1000,	0,	'<p>Suitable for who have acidic gastric, don&rsquo;t like strong coffee taste. Aromatic coffee taste with smooth milky taste. Instant coffee powder, caster sugar, Non-Dairy Creamer.</p>\r\n\r\n<p><strong>Product Features:</strong> ◎ Used Light Roasted Coffee Beans (Less Acidic) ◎ Caffeine: 0.13% ( 39mg/cup ) ◎ Low Sugar ◎ No Artificial Favoring ◎ Won&rsquo;t get Heaty ◎ Less Bitterness <strong> Ingredients:</strong> ◎ Instant Coffee Powder ◎ Caster Sugar ◎ Non-Dairy Creamer</p>\r\n\r\n<p><strong>Aftertaste Review:</strong></p>\r\n\r\n<p>Aromatic Coffee Taste with a Smooth Milky Taste.</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"1\" rowspan=\"1\">\r\n			<p>Taste</p>\r\n			</td>\r\n			<td colspan=\"1\" rowspan=\"1\">\r\n			<p>White coffee with less bitterness</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"1\" rowspan=\"1\">\r\n			<p>Feature</p>\r\n			</td>\r\n			<td colspan=\"1\" rowspan=\"1\">\r\n			<p>Low Sugar</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"1\" rowspan=\"1\">\r\n			<p>Certification</p>\r\n			</td>\r\n			<td colspan=\"1\" rowspan=\"1\">\r\n			<p>HALAL</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"1\" rowspan=\"1\">\r\n			<p>Shelf Life</p>\r\n			</td>\r\n			<td colspan=\"1\" rowspan=\"1\">\r\n			<p>18 months</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h2><strong>Introduction of White Coffee</strong></h2>\r\n\r\n<p>White Coffee is a native drink in Malaysia that having a history more than 100 years ago. Mostly Non-Malaysian will think that white coffee is having a white color in appearance and having a coffee taste.<br />\r\nBut, the actual white coffee is different from other coffee by its own special method of how they roast the coffee beans. Made by roasting coffee beans in a medium-low temperature that is half of the time that regular coffee beans is roasted, which removes about 97% of the caffeine from the beans.<br />\r\nWith the roaster at temperature above 200&deg;c, each coffee beans is roasted to a level that removes the bitterness, sourness, and caffeine content to it&#39;s best characteristic of it&#39;s aroma, pure, flavor and aftertasting. A combination of Liberica, Arabica and Robusta coffee beans, using the special grade of creamer and sugar, this have made the white coffee on its highest consistency of quality.</p>',	87,	'Liza',	0.00,	0.00,	2,	0,	0,	25,	2,	'Uc62ab8ddaa8648c2883b53369f6fea07l.jpg',	NULL,	'malaysia-low-acid-white-coffee-carton-box',	'2021-03-16 05:05:58',	'2021-03-16 17:05:58',	'2021-03-17 08:19:46',	NULL,	5,	NULL),
