(344,	'High quality instant coffee for coffee roasters',	'good price high quality instant coffee for coffee roasters in SaudiArabia/Turkey/UAE/Egypt/Qatar/Kuwait Code SR',	'<p>good price high quality instant coffee for coffee roasters in SaudiArabia/Turkey/UAE/Egypt/Qatar/Kuwait Code SR</p>',	'good price high quality instant coffee for coffee roasters in SaudiArabia/Turkey/UAE/Egypt/Qatar/Kuwait Code SR',	1000,	0,	'<p>One of the Coffee Manufacturer and Exporter of&nbsp;<strong>Spray Dried Instant Coffee Powder</strong>&nbsp;is extracted from 100% pure bean of coffee of Buon Ma Thuot City, where the capital of Vietnam for manufacturing and modern technology used to keep natural aroma of instant coffee.</p>\r\n\r\n<p>With hieght of 1500 above sea level and climate condition is favorable for growing coffee Beside, Anthaigroup&#39;s factory located in coffee material area to be convenient for choosing the best coffee material resources to produce, reduce cost of transport material, cost of cheap labour. with this advantages, we have provide products with the best quality and price compared with other coffee supplier.</p>',	87,	'Liza',	0.00,	0.00,	2,	0,	0,	25,	2,	'Hdec5090544a34f4a92e7e5f16b456735K.jpg',	NULL,	'high-quality-instant-coffee-for-coffee-roasters-1',	'2021-03-17 10:36:41',	'2021-03-17 10:36:41',	'2021-03-17 11:07:08',	NULL,	1,	NULL),
(345,	'Weight loss diet keto coffee',	'Weight loss diet using mct oil bulletproof keto coffee',	'<p>Weight loss diet using mct oil bulletproof keto coffee</p>',	'Weight loss diet using mct oil bulletproof keto coffee',	45,	0,	'<table border=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Product Name</strong></td>\r\n			<td>&nbsp;&nbsp;Keto Coffee with C8 MCT Oil</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Powder&nbsp;Type</strong></td>\r\n			<td>&nbsp;&nbsp;C8 MCT oil instant coffee powder</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Packaging Details</strong></td>\r\n			<td>&nbsp;&nbsp;20g/ Sachet Pack</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Main function</strong></td>\r\n			<td>&nbsp;&nbsp;Help people who want to lose weight through keto diet</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Flavor</strong></td>\r\n			<td>&nbsp;&nbsp;Mellow Coffee Flavor With Very Good Taste</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Ingredients</strong></td>\r\n			<td>&nbsp;&nbsp;Coffee powder (Arabica Bean),&nbsp;C8 MCToil, frass-fed butter, organic ghee&nbsp; &nbsp; &nbsp; &nbsp; and coconut oil.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\"><strong>Ingredients introduction</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<p>By combining Arabicacoffee powder with MCT oil,C8 MCT oil, frass-fed butter, organic ghee and coconut oil, we developed a new smooth tasting Bulletproof keto coffee choice with high fat and zero carb.Packed in 20g sachet&nbsp;x7 box pack for retail sales and bulk pack of 5kg for distributor. Quickly replenishes mind and body energy. Low sugar, low protein. Light and smooth taste.</p>\r\n\r\n			<p>Place of origin: Taiwan</p>\r\n\r\n			<p>Effective date: as indicated; shelf life 24 months</p>\r\n\r\n			<p>Storage: Store in a cool dry place</p>\r\n\r\n			<p>How to use: Add 120~150ml hot water, stir well and drink. Adjust the taste according to your personal preference</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>',	87,	'Liza',	0.00,	0.00,	2,	0,	0,	25,	2,	'U3d81120321974402bc4528489b428f8eM.jpg',	NULL,	'weight-loss-diet-keto-coffee',	'2021-03-17 11:15:14',	'2021-03-17 11:15:14',	'2021-03-22 08:55:41',	NULL,	3,	NULL),
(346,	'For Nescafes Instant Coffee Classic 3in1 Original',	'For Nescafes Instant Coffee Classic 3in1 Original',	'<p>For Nescafes Instant Coffee Classic 3in1 Original</p>',	'For Nescafes Instant Coffee Classic 3in1 Original',	5,	0,	'<p>Nescafe is a brand of coffee made by Nestle. It comes in many different forms. The name is a portmanteau of the words &quot;Nestle&quot; and &quot;cafe&quot; Nestle first introduced their flagship coffee brand in Switzerland on 1 April 1938.<br />\r\n<br />\r\nNestle began developing a coffee brand in 1930, at the initiative of the Brazilian government, to help to preserve the substantial surplus of the annual Brazilian coffee harvest. Max Morgenthaler led the development project.<br />\r\n<br />\r\nOur coffee specialist, Max Morgenthaler, was on a mission to create a delicious cup of coffee simply by adding water. Max and his team worked hard to find a new way to make instant coffee that would retain the coffee&#39;s natural flavour. In 1938, they found the answer, and NESCAFE was born. Named by using the first three letters in Nestle and suffixing it with &#39;caf&eacute;&#39;, NESCAFE became the new name in coffee.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Nescafe Gold Cappuccino 17g</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; An aromatic blend of Arabica &amp; Robusta Coffee with milk for a taste of Cappuccino.<br />\r\n<br />\r\nThe generous milky froth on top creates a delicious coffee experience.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Enjoy a NESCAFE GOLD Cappuccino whether you&#39;re at home or at work. No matter where your day takes you, take a break with a coffee that has been crafted by experts from beginning to end.<br />\r\n<br />\r\nNESCAFE is the world&#39;s favourite coffee brand, enjoyed in over 180 countries worldwide. With over 75 years of experience in selecting, roasting and blending the very best coffee, it&#39;s no surprise that over 5,500 cups of NESCAFE coffee are drunk every second!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ingredients;<br />\r\nSugar, Skimmed Milk Powder (18%), Glucose Syrup, Coffee (11.8%) [Instant Coffee (11%), (Roast and Ground Coffee)], Coconut Oil, Lactose, Salt [Sodium Chloride, Anti-Caking Agent (E535)], Acidity Regulator (E340), Stabilisers (E331, E452)</p>\r\n\r\n<p><img alt=\"For Nescafes Instant Coffee Classic 3in1 Original\" src=\"https://sc04.alicdn.com/kf/Uc0428a099cd84b08a56a0dd59cd76451r/1006578317/Uc0428a099cd84b08a56a0dd59cd76451r.jpeg\" style=\"height:750px; width:750px\" /><img alt=\"For Nescafes Instant Coffee Classic 3in1 Original\" src=\"https://sc04.alicdn.com/kf/U30b55b176b8e43c094a0df84883b1435U/1006578317/U30b55b176b8e43c094a0df84883b1435U.jpg\" style=\"height:600px; width:600px\" /><img alt=\"For Nescafes Instant Coffee Classic 3in1 Original\" src=\"https://sc04.alicdn.com/kf/U723b7da22dbc43ab987fc38995e70869R/1006578317/U723b7da22dbc43ab987fc38995e70869R.png\" style=\"height:330px; width:279px\" /><img alt=\"For Nescafes Instant Coffee Classic 3in1 Original\" src=\"https://sc04.alicdn.com/kf/Uc16f42bb36ac4f519a3b64b32ced33e6t/1006578317/Uc16f42bb36ac4f519a3b64b32ced33e6t.jpg\" style=\"height:300px; width:300px\" /><img alt=\"For Nescafes Instant Coffee Classic 3in1 Original\" src=\"https://sc04.alicdn.com/kf/U09a1872afcf44dafa29372dde3730e46e/1006578317/U09a1872afcf44dafa29372dde3730e46e.jpg\" style=\"height:500px; width:500px\" /><img alt=\"For Nescafes Instant Coffee Classic 3in1 Original\" src=\"https://sc04.alicdn.com/kf/Ub61352dde6e3499d832df1521cbc38bbG/1006578317/Ub61352dde6e3499d832df1521cbc38bbG.jpg\" style=\"height:680px; width:680px\" /><img alt=\"For Nescafes Instant Coffee Classic 3in1 Original\" src=\"https://sc04.alicdn.com/kf/U4eaac4addc3b4f90a6232ebaa746d334e/1006578317/U4eaac4addc3b4f90a6232ebaa746d334e.jpg\" style=\"height:500px; width:500px\" /></p>',	87,	'Liza',	0.00,	0.00,	2,	0,	0,	25,	2,	'U1477a6d642bb4273b2802bbc7c9ec9ceG.jpeg',	NULL,	'for-nescafes-instant-coffee-classic-3in1-original',	'2021-03-1