(758,	'Vietnam Vegetable Fresh Purple Yam For Dessert',	'Vietnam Vegetable Fresh Purple Yam For Dessert',	'<p>Vietnam Vegetable Fresh Purple Yam for Dessert</p>',	'Vietnam Vegetable Fresh Purple Yam For Dessert',	1000,	0,	'<p>Style:&nbsp;Fresh</p>\r\n\r\n<p>Product Type:&nbsp;Other</p>\r\n\r\n<p>Color:&nbsp;Purple</p>\r\n\r\n<p>Part:&nbsp;Root</p>\r\n\r\n<p>Cultivation Type:&nbsp;Organic</p>\r\n\r\n<p>Place of Origin:&nbsp;Ba Ria-Vung Tau, Vietnam</p>\r\n\r\n<p>Brand Name:&nbsp;DSW Co.,ltd</p>\r\n\r\n<p>Model Number:&nbsp;0031</p>\r\n\r\n<p>Type:&nbsp;Yam</p>\r\n\r\n<p>Look:&nbsp;Purple</p>\r\n\r\n<p>Size:&nbsp;diameter : 3.5 cm + , length : 35cm + ; d : 4.0cm + . L : 40 cm +</p>\r\n\r\n<p>Origin:&nbsp;Long an province Vietnam</p>\r\n\r\n<p>MOQ:&nbsp;1x20 Feet Container</p>\r\n\r\n<p><em>Purple yam is used in a variety of desserts, as well as a flavor for ice cream, milk, Swiss rolls, tarts, cookies, cupcakes, cakes and other types of pastries. In the Philippines, it is known as ube and is often eaten boiled, baked, or as a sweetened pudding called ube halay&aacute;; the latter is a popular ingredient in the iced dessert called halo-halo. In Maharashtra, the stir-fried chips are eaten during religious fasting.[citation needed] Purple yam is an essential ingredient in Undhiyu.] Purple yam is a popular dessert in Jaffna, Sri Lanka. Ube has more recently appeared in American restaurants as well. It is being used to make truffles, leche, flan, donuts, cupcakes, and other pastries.</em></p>',	87,	'Liza',	0.00,	0.00,	2,	0,	0,	58,	2,	'H702b9158a18a42b196835fd5afe284a1q.jpg',	NULL,	'vietnam-vegetable-fresh-purple-yam-for-dessert',	'2021-04-01 03:30:24',	'2021-04-01 15:30:24',	'2021-04-05 07:35:56',	NULL,	1,	NULL),
